import {Card} from "antd";
import Title from "antd/es/skeleton/Title";

function AdComponent(props) {
    const {naslov, sadrzaj} = props;

    return (
        <Card>
            <Title strong>{naslov}</Title>
            {sadrzaj}
        </Card>
    );
};

export default AdComponent;
